css:
@import url('https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap');


@font-face {font-family: "Roboto";}




.dhx_cal_event { background-color: #ffffff00;}

.dhx_cal_event_line_start {border-top-left-radius: 8px; border-bottom-left-radius: 8px;}

.dhx_cal_event_line_end {border-top-right-radius: 8px; border-bottom-right-radius: 8px;}

.dhx_cal_event.CALENDAR-INDEX-0 .dhx_body, .dhx_cal_event.CALENDAR-INDEX-0 .dhx_title, .dhx_cal_event_line.CALENDAR-INDEX-0 { border-top-left-radius: 8px; border-bottom-left-radius: 8px; background-color: #0000ff33; color: #000000; border-left-color: #0000ff; border-left-width: 3px; font-family: Roboto; font-size: 10px;}

.dhx_cal_event.CALENDAR-INDEX-1 .dhx_body, .dhx_cal_event.CALENDAR-INDEX-1 .dhx_title, .dhx_cal_event_line.CALENDAR-INDEX-1 { border-top-left-radius: 8px; border-bottom-left-radius: 8px; background-color: #47006833; color: #000000; border-left-color: #470068; border-left-width: 3px; font-family: Roboto; font-size: 10px;}

.dhx_cal_event.CALENDAR-INDEX-2 .dhx_body, .dhx_cal_event.CALENDAR-INDEX-2 .dhx_title, .dhx_cal_event_line.CALENDAR-INDEX-2 { border-top-left-radius: 8px; border-bottom-left-radius: 8px; background-color: #cc000033; color: #000000; border-left-color: #cc0000; border-left-width: 3px; font-family: Roboto; font-size: 10px;}

.dhx_cal_event.CALENDAR-INDEX-3 .dhx_body, .dhx_cal_event.CALENDAR-INDEX-3 .dhx_title, .dhx_cal_event_line.CALENDAR-INDEX-3 { border-top-left-radius: 8px; border-bottom-left-radius: 8px; background-color: #00cc0033; color: #000000; border-left-color: #00cc00; border-left-width: 3px; font-family: Roboto; font-size: 10px;}

.dhx_cal_event.CALENDAR-INDEX-3 .dhx_body, .dhx_cal_event.CALENDAR-INDEX-4 .dhx_title, .dhx_cal_event_line.CALENDAR-INDEX-4 { border-top-left-radius: 8px; border-bottom-left-radius: 8px; background-color: #cccc0033; color: #000000; border-left-color: #cccc00; border-left-width: 3px; font-family: Roboto; font-size: 10px;}


.dhx_cal_event_clear.CALENDAR-INDEX-0 { color:#0000ff; font-family: Roboto; font-size: 10px;}

.dhx_cal_event_clear.CALENDAR-INDEX-1 { color:#470068; font-family: Roboto; font-size: 10px;}

.dhx_cal_event_clear.CALENDAR-INDEX-2 { color:#cc0000; font-family: Roboto; font-size: 10px;}

.dhx_cal_event_clear.CALENDAR-INDEX-3 { color:#00cc00; font-family: Roboto; font-size: 10px;}

.dhx_cal_event_clear.CALENDAR-INDEX-4 { color:#cccc00; font-family: Roboto; font-size: 10px;}



.dhx_cal_event_clear.CALENDAR-INDEX-0::before { background:#0000ff; }

.dhx_cal_event_clear.CALENDAR-INDEX-1::before { background:#470068; }

.dhx_cal_event_clear.CALENDAR-INDEX-2::before { background:#cc0000; }

.dhx_cal_event_clear.CALENDAR-INDEX-3::before { background:#00cc00; }

.dhx_cal_event_clear.CALENDAR-INDEX-4::before { background:#cccc00; }


.dhx_cal_container { background-color: rgba(255,255,255,.3);backdrop-filter: blur(4px);}

.dhx_cal_header { background-color: rgba(255,255,255,.3);}

.dhx_scale_bar, dhx_cal_data, .dhx_month_body,.dhx_month_head,.dhx_month_body, .dhx_month_body { background-color: rgba(255,255,255,.1);}


.dhx_before, .dhx_before .dhx_month_head, .dhx_before .dhx_month_body { background-color:#88888810; }

.dhx_after,  .dhx_after  .dhx_month_head, .dhx_after  .dhx_month_body { background-color:#88888810; }


.dhx_cal_month_cell {background-color: transparent;}

.dhx_cal_quick_info {display: none;}


.scheduler_tooltip["calendarlabs"] {display: none;}
